Gree + brings you a brand new experience for intelligent control. As a new official application software that Gree  develops specially for IoT era, it has the functions of appliances management, intelligent control, etc., which makes your life much easier.  

Function introductions:
1、Intelligent products can be easily added into Gree ecosystem for intelligent management uniformly;
2、You can control the appliance at anytime and anywhere you like;
3、You can know the status of the appliance in real time and all changes of appliance status will be reported to you immediately。

Clean up your device by using a unique smart cleaner. You can clean up similar photos and videos with a few taps. You do not only delete similars but can add photos and videos to Secret Albums, as well as contacts to Secret Contacts. Information in Secret Space will be securely hidden from prying eyes with Passcode Protection.

The Organize Contacts feature lets you merge duplicate contacts and fill in missing information in contacts. The Adblocker feature allows you to get rid of annoying ads.
Now, you do not have to download and install multiple apps to organize contacts and free up space on your phone.

Premium Features:
- Easy, fast, and smart cleaning;
- Clean up similar photos and videos;
- Compress Video feature to clean up more memory on your device;
- Organize Contacts;
- Secret Space for files and contacts;
- Protect your data with Passcode Protection;
- Ads blocker;

